import React from 'react'

function AddTodo() {
  return (
    <form style={{display: 'flex'}}>
      <input 
      type ="tex" 
      name="title" 
      style={{flex: '10', padding: '5px'}}
      placeholder="Add your todo...."/>
      <input
      type="submit"
      value="Submit"
      className="btn"
      style={{flex: '1'}}
      />
    </form>
  )
}

export default AddTodo
